import React, { useState } from 'react'

const Contact = () => {
  const [name, setName] = useState('');
  return (
    <div>
      <form className='form-group'>
        <label htmlFor='name'>
          Your Name
          <input type='text' id='name' name='name' value={name} onChange={(e) => setName(e.target.value)} />
        </label>
      </form>
    </div>
  )
}

export default Contact
